import React from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
    const navigate =useNavigate ();

  const handleSellerClick = () => {
    // Redirect to the seller page
    navigate ('/seller');
  };

  const handleBuyerClick = () => {
    // Redirect to the buyer page
    navigate ('/buyer');
  };

  return (
    <div className="landing-page">
      <h1>Welcome to Our Website</h1>
      <div className="options">
        <div className="option" onClick={handleSellerClick}>
          <img src="/seller-image.jpg" alt="Seller" />
          <p>Seller Page</p>
        </div>
        <div className="option" onClick={handleBuyerClick}>
          <img src="/buyer-image.jpg" alt="Buyer" />
          <p>Buyer Page</p>
        </div>
      </div>
    </div>
  );
};

